import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  const [click, setClick] = useState(false);
  const [dropdown, setDropdown] = useState(false);

  const handleClick = () => setClick(!click);
  const closeMenu = () => setClick(false);
  const toggleDropdown = () => setDropdown(!dropdown);

  return (
    <div className='header'>
      <nav className='navbar'>
        <Link to='/home' className='logo'>
          <h1>BrightPath</h1>
        </Link>
        <div className='search-container'>
          <input type='text' className='search' placeholder='Search Class' />
        </div>
        <ul className={click ? "nav-menu active" : "nav-menu"}>
          <li className='nav-item'>
            <Link to='/home' onClick={closeMenu}>Home</Link>
          </li>
          <li className='nav-item'>
            <Link to='/about' onClick={closeMenu}>About Us</Link>
          </li>
          <li className='nav-item'>
            <Link to='/class' onClick={closeMenu}>Classes</Link>
          </li>
          <li className='nav-item' onClick={toggleDropdown}>
            <img src='/images/account.png' alt='' className='nav-account'/>
            {dropdown && (
              <div className='dropdown-menu'>
                <Link to='/profile' className='dropdown-item' onClick={closeMenu}>Profile</Link>
                <Link to='/logout' className='dropdown-item' onClick={closeMenu}>Logout</Link>
              </div>
            )}
          </li>
        </ul>
        <div className='menu-icon' onClick={handleClick}>
          <i className={click ? 'fas fa-times' : 'fas fa-bars'}></i>
        </div>
      </nav>
    </div>
  );
}

export default Navbar;
